import React, {useState} from 'react';
import {Button} from "react-bootstrap";
import {useNavigate} from "react-router-dom";
import AuthService from "../../services/AuthService";

const RegistrationForm = () => {

    const navigate = useNavigate();

    const handleSubmit = async (event) => {
        event.preventDefault();
        AuthService.registration(registrationRequest).then(() => {
            navigate("/");
        });
    };

    const [registrationRequest, registrationRequestData] = useState({
        email: "",
        name: "",
        phonenumber: "",
        password: ""
    });

    const handleChange = (event) => {
        const {name, value} = event.target;
        registrationRequestData((prevFormData) => ({
            ...prevFormData,
            [name]: value,
        }));
    };


    return (
        <>
            <div className={"container"}>
                <div className={"row"}>
                    <form onSubmit={handleSubmit}>
                        <div className={"col-xl-12"}>
                            <div className={"row"}>
                                <div className={"offset-xl-3 col-xl-6 mt-3"}>
                                    <input placeholder="Email" className={"form-control"} type="text" id="username"
                                           name="email" value={registrationRequest.email} onChange={handleChange}/>
                                </div>
                                <div className={"offset-xl-3 col-xl-6 mt-2"}>
                                    <input placeholder="Name" className={"form-control"} type="text" id="password"
                                           name="name" value={registrationRequest.name} onChange={handleChange}/>
                                </div>
                                <div className={"offset-xl-3 col-xl-6 mt-2"}>
                                    <input placeholder="Phone number" className={"form-control"} type="text" id="password"
                                           name="phonenumber" value={registrationRequest.phonenumber} onChange={handleChange}/>
                                </div>
                                <div className={"offset-xl-3 col-xl-6 mt-2"}>   
                                    <input placeholder="Password" className={"form-control"} type="password" id="password"
                                           name="password" value={registrationRequest.password} onChange={handleChange}/>
                                </div>
                                <div className={"offset-xl-8 col-xl-1 mt-2"}>
                                    <Button style={{color: "white"}} variant={"primary"} type="submit">Submit</Button>
                                </div>
                            </div>
                        </div>
                    </form>
                </div>
            </div>
        </>
    );
};

export default RegistrationForm;
